-- CARREGA JUDOCAS
--DELETE FROM JUDOCA ;
SELECT ROW_NUMBER() OVER(ORDER BY nome) AS id, 
       nome                             AS nome,
       1                                AS id_funcao
FROM (SELECT DISTINCT la.quem_faz AS nome
      FROM CONVERSAO_LUTA_ACAO la
      WHERE la.quem_faz NOT IN ('', '<ARBITRO_DESCONHECIDO>')
      UNION
      SELECT DISTINCT la.quem_sofre AS nome
      FROM CONVERSAO_LUTA_ACAO la
      WHERE la.quem_sofre NOT IN ('', '<ARBITRO_DESCONHECIDO>')
      UNION
      SELECT '<ARBITRO_DESCONHECIDO>') LUTADOR
ORDER BY nome
;

-- CARREGA LUTAS

-- CARREGA LUTA_ACAO
DELETE FROM LUTA_ACAO ;
  sequencia,
  momento,
  id_quem_faz,
  id_quem_recebe,
  id_acao,
  id_tecnica,
  id_direcao,
  id_pontuacao,
  id_motivo_penalizacao)
 SELECT la.id_luta                                         AS id_luta,
	la.sequencia                                       AS sequencia,
	TO_TIMESTAMP(REPLACE(la.momento_inicio,',','.'),'HH24:MI:SS.MS')      AS momento,
	(SELECT id FROM JUDOCA WHERE nome = la.quem_faz)   AS id_quem_faz,
	(SELECT id FROM JUDOCA WHERE nome = la.quem_sofre) AS id_quem_recebe,
	(SELECT id
	 FROM CONVERSAO_ACAO
	 WHERE cd_conversao = la.cd_conversao
	   AND nome_tipo_conversao = la.acao_tipo
	   AND nome_conversao = la.acao)                   AS id_acao,
        (SELECT id
         FROM CONVERSAO_TECNICA
         WHERE cd_conversao = la.cd_conversao
           AND nome_conversao = la.tecnica)                AS id_tecnica,
	(SELECT id
	 FROM CONVERSAO_TECNICA_DIRECAO
	 WHERE cd_conversao = la.cd_conversao
	   AND id_conversao = la.direcao)                  AS id_direcao,
	(SELECT id
	 FROM CONVERSAO_TECNICA_PONTUACAO
	 WHERE cd_conversao = la.cd_conversao
	   AND nome_conversao = la.pontuacao)              AS id_pontuacao,
	NULL                       AS id_motivo_penalizacao
 FROM CONVERSAO_LUTA_ACAO la
 WHERE la.cd_conversao = 1
   --AND la.id_luta = 77
 ORDER BY id_luta, sequencia
 ;


